function Personalinfo() {
    const info = [{ "name": "ck", "id": "1" }, 
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" },
    { "name": "cc", "id": "2" }];

    return (
        <div className="flex flex-row">
            {Array.from(info).map(entry => {
                return <div className="p-6 max-w-sm mx-auto bg-white rounded-xl shadow-lg  items-center ">
                    <p>{entry.name}</p>
                    <p>{entry.id}</p>
                </div>
            })}

        </div>
    );
}
export default Personalinfo;
